import React, {useState, useEffect} from 'react';
import Table from 'react-bootstrap/Table';
import UserService from '../user/services/user-services';
import getProfessionalsResults from '../user/services/user-services';

const Ammattilaiset = () => {
    const [results, setResults] = useState([]);
    useEffect (() =>{
        getProfessionalsResults().then(response => setResults(response));
    }, [])
    console.log(results);
    let personCount=0;
    const count = () => {
        return personCount++;
    };
    let resultArray = results.map(count);
    console.log(resultArray);
    
    const professionalsResults = results.map((result, index) =>
    <>
    <tr><td key={index}>{result.date}</td></tr><tr><td>{result.date}</td></tr>
    //<td>{personCount++}</td>
    </>
    );
    
    return(
        <div id="table-div">
            <Table striped bordered hover size="sm">
                <thead>
                    <tr>
                    <th>Pvm</th>
                    <th>Suoritukset yhteens√§</th>
                    <th>Suorittajalkm</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    {professionalsResults}
                    </tr>
                    <tr>
                    <td>Jacob</td>
                    <td>Thornton</td>
                    <td>@fat</td>
                    </tr>
                    <tr>
                    <td></td>
                    <td>Larry the Bird</td>
                    <td>@twitter</td>
                    </tr>
                </tbody>
            </Table>
        </div>
    )
}
export default Ammattilaiset;
